import React, { forwardRef } from "react";

const images = ["leaf2", "leaf2_"];
const mobileImages = {};
const desktopImages = {};

images.forEach((name) => {
  mobileImages[name] = require(`../images/mobile/contact/${name}.png`);
  desktopImages[name] = require(`../images/desktop/contact/${name}.png`);
});

const Contact = forwardRef(({ id }, ref) => {
  return (
    <div id={id} ref={ref}>
      <div className="homeBg">
        <div className="container">
          {images.map((name) => (
            <picture key={name}>
              <source srcSet={desktopImages[name]} media="(min-width:1025px)" />
              <img className={name} src={mobileImages[name]} alt="" />
            </picture>
          ))}
        </div>
      </div>
    </div>
  );
});

export default Contact;
